I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io api. I've been looking at the documentation for the elevenlabs.io api and the `clipboard` crate, but I'm not sure how to put it all together.

Here's what I have so far:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<TextToSpeechResponse, reqwest::Error> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json()
        .await?;

    Ok(response)
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents().unwrap();
    let response = text_to_speech(&client, &text).await?;
    println!("{:?}", response);

    Ok(())
}
```

I'm not sure how to play the audio from the response, or if I even need to do that since the API returns a base64 encoded audio file. I'm also not sure if I need to use the `clipboard` crate or if there's a better way to get the contents of the clipboard.

Any help would be appreciated!

## Answer (1)

You can use the `rodio` crate to play the audio. Here's an example of how you can do it:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use rodio::{Decoder, Sink, Source};
use std::io::Cursor;

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<TextToSpeechResponse, reqwest::Error> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json()
        .await?;

    Ok(response)
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents().unwrap();
    let response = text_to_speech(&client, &text).await?;
    let decoded_audio = base64::decode(&response.audio)?;
    let cursor = Cursor::new(decoded_audio);
    let source = Decoder::new(cursor)?;
    let (_stream, stream_handle) = rodio::OutputStream::try_default()?;
    stream_handle.play_raw(source.convert_samples());
    Ok(())
}
```

This code decodes the base64 audio file and plays it using `rodio`.

 I'm using typeorm with postgres and I want to store json in my entity. How can I do that?

## Answer (1)

You can use `json` or `jsonb` type in PostgreSQL. In TypeORM you can use `JsonObject` or `JsonArray` types.

```
@Entity()
export class MyEntity {
  @Column('json')
  myJson: JsonObject;
}
```

